import React from 'react';
import './InfoPage.css';
import { useNavigate } from 'react-router-dom';


function InfoPage() {
  const navigate = useNavigate();
  return (
    <div className="info-page">
      <h2>What is Ransomware?</h2>
      <p>Ransomware is a type of malicious software (malware) that locks or encrypts a user's data, demanding payment (usually cryptocurrency) to restore access to the data.</p>
      
      <h3>How to Prevent Ransomware:</h3>
      <ul>
        <li>Regularly backup important files</li>
        <li>Use strong passwords and multi-factor authentication</li>
        <li>Keep your system and antivirus updated</li>
        <li>Avoid clicking on suspicious links and attachments in emails</li>
      </ul>
      <button onClick={() => navigate('/')}>Back to Home</button>
    </div>
  );
}

export default InfoPage;
